import './App.css';
import Top from './components/Top'
function App() {
  return (
    <div className="App">
      <Router>
        <Top/>  
          <Routes>
            <Route path="/" element={<Layout />}>
              <Route index element={<Home />} />
              <Route path="/blogs" element={<Blogs />} />
              <Route path="/about" element={<About />} />
            </Route>
          </Routes>
        </Router>
    </div>
  );
}
export default App;
